import React from 'react'
import { Tab } from 'semantic-ui-react'
import UserTable from './UserTable'
import BookTable from './BookTable'

function AdminTab(props) {
  const { handleInputChange } = props
  const { isUsersLoading, users, userEmailSearch, handleDeleteUser, handleSearchUser } = props
  const { isBooksLoading, books, bookIsbn, bookTitle, bookTextSearch, handleAddBook, handleDeleteBook, handleSearchBook } = props

  const panes = [
    {
      menuItem: { key: 'users', icon: 'users', content: 'Users' },
      render: () => (
          <Tab.Pane loading={isUsersLoading}>
            <UserTable
                users={users}
                userEmailSearch={userEmailSearch}
                handleInputChange={handleInputChange}
                handleDeleteUser={handleDeleteUser}
                handleSearchUser={handleSearchUser}
            />
          </Tab.Pane>
      )
    },
    {
      menuItem: { key: 'books', icon: 'book', content: 'Books' },
      render: () => (
          <Tab.Pane loading={isBooksLoading}>
            <BookTable
                books={books}
                bookIsbn={bookIsbn}
                bookTitle={bookTitle}
                bookTextSearch={bookTextSearch}
                handleInputChange={handleInputChange}
                handleAddBook={handleAddBook}
                handleDeleteBook={handleDeleteBook}
                handleSearchBook={handleSearchBook}
            />
          </Tab.Pane>
      )
    }
  ]

  return (
      <Tab menu={{ attached: 'top' }} panes={panes} />
  )
}

export default AdminTab
